@Trevormowad You spent your whole life pouring into others. God put you on earth for a reason. You always gave your all to my husband @DangeRussWilson, me, our family, and team. I’m going to miss our pre game and post game talks. Going to miss your humor. Going to miss our brother and friend. You battled with cancer 3 times, and in your battles you were showing others how to fight, encouraging us all. You fought a good fight. You always took care of everyone. I know God is going to take great care of you. No more pain Trev. We love you so much. 
Matthew 25:23.
#Ittakeswhatittakes ❤️

